import React from 'react';
import Booking from './Bookings';


const BookingList = (props) => {


    const currentDate = props.currentDate;

    const bookingDetails = props.data.map((booking, index) =>{
        return (
          <Booking key={index}
          name={booking.name}
          discount={booking.discount}
          time={booking.time}
          table={booking.table}
          partySize={booking.partySize}>
          </Booking>
        );
      });

    return(
      <>
        <h2>Bookings for {currentDate}</h2>
        <table>
          <tbody>
          <tr>
          <th>Name</th>
          <th>Discount Level</th>
          <th>Time</th>
          <th>Table</th>
          <th>Party Size</th>
          </tr>
          </tbody>
          {bookingDetails}
        </table>
      </>
    );
  };

export default BookingList;
